import './Nav.css';
import Tm from './Tm';
const Nav=()=>
{
    return(
    <div className="navmain">
        <div id='navsub'>
            <div id='logo'>
                <h1>TBB<sup><Tm/></sup></h1>
            </div>
            <div id='navitems'>
                <div id='navitem1'>
                    <h3>Products</h3>
                </div>
                <div id="navitem2">
                    <h3>Cart</h3>
                </div>
                <div id='navitem3'>
                    <h3>User</h3>
                </div>
            </div>
        </div>
    </div>
    );
}

export default Nav;
